import React from 'react';
import "./Login.css"

export default class Login extends React.Component{
    constructor() {
        super();
    }

    onSubmit = (e) => {
        alert("登录成功")
        e.preventDefault();
    }
    render() {
        return(
            <div className="login-container">
                <form className="login-form-container" onSubmit={this.onSubmit}>
                    <div className="login-form-input-container">
                        <label className="login-form-input-item">
                            <svg className="icon svg-category" aria-hidden="true">
                                <use xlinkHref="#icon-category" />
                            </svg>
                            <input className="login-form-input" required type="number" minLength={6} maxLength={16}/>
                        </label>
                        <label className="login-form-input-item">
                            <svg className="icon svg-category" aria-hidden="true">
                                <use xlinkHref="#icon-category" />
                            </svg>
                            <input className="login-form-input" required type="password" maxLength={20}/>
                        </label>
                    </div>
                    <button type="submit">登录/注册</button>
                </form>
            </div>
        )
    }
}
